import './Tarjeta.css';

function Tarjeta() {
  return (
    <form>
        <div class="icon">
            <img src="./sources/profile-user.png" alt="Icono de usuario"></img>
        </div>  
        <h1 class="tittle">Login</h1>
        <label class="usuario">
            <img src="./sources/id.png" alt="id"></img>
            <input type="text" name="nombre" placeholder="Nombre" required></input>
        </label>
        <br></br>
        <label class="contraseña">
            <img src="./sources/padlock.png" alt="id"></img>
            <input type="password" name="password" placeholder="Contraseña" required></input>
        </label>
        <a href="recupera.html">Olvidaste tu contraseña?</a>
        <button id="button">Login</button>
    </form>
  );
}

export default Tarjeta;
